// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import "@chainlink/contracts/src/v0.6/VRFConsumerBase.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract URLShortener is VRFConsumerBase, Ownable {
    struct Click{
        string location;
        uint256 timestamp;
    }
    mapping(uint256 => string) public urlMap;
    mapping(uint256 => bool) public pathKey;
    mapping(uint256 => uint256) public registeredKey;
    uint keyCounter;
    mapping(string => Click[]) public urlClicks;
    string public URLPendingRegistration;
    uint256 public maxKey = 899;

    uint256 public randomness;
    uint256 public fee;
    bytes32 public keyhash;
    event RequestedRandomness(bytes32 requestId);

    constructor(
        address _vrfCoordinator,
        address _link,
        uint256 _fee,
        bytes32 _keyhash
    ) public VRFConsumerBase(_vrfCoordinator, _link) {
        fee = _fee;
        keyhash = _keyhash;
        keyCounter = 0;
    }

    function registerUrl(string memory _pathValue) public{
        bytes32 requestId = requestRandomness(keyhash, fee);
        URLPendingRegistration = _pathValue;
        emit RequestedRandomness(requestId);
    }

    function registerClicks(uint256 _pathKey, string memory _location) public {
        require(pathKeyContains(_pathKey), "Path Does not exist");
        urlClicks[urlMap[_pathKey]].push(Click(_location, block.timestamp));
    }

    function retrieveUrl(uint256 _pathKey) public view returns(string memory) {
        return urlMap[_pathKey];
    }

    function retrieveClicksNumber(string memory _URIpath) public view returns(uint256) {
        return urlClicks[_URIpath].length;
    }

    function retrieveClickInformation(string memory _URIpath, uint256 _index) public view returns(string memory, uint256) {
        return (urlClicks[_URIpath][_index].location, urlClicks[_URIpath][_index].timestamp);
    }

    function pathKeyContains(uint256 _pathKey) internal returns (bool) {
        return pathKey[_pathKey];
    }

    function fulfillRandomness(bytes32 _requestId, uint256 _randomness)
        internal
        override
    {
        require(_randomness > 0, "random-not-found");
        uint256 k = 0;
        uint256 randomKey;
        while (true){
            randomKey = ((_randomness - k) % maxKey) + 100;
            if (pathKeyContains(randomKey) == false) break;
            k++;
            require( k <= maxKey, "Max URL Limit reached. No new URL can be registered!");
        }

        urlMap[randomKey] = URLPendingRegistration;
        pathKey[randomKey] = true;
        URLPendingRegistration = "";
        registeredKey[keyCounter] = randomKey;
        randomness = _randomness;
    }
}
